import React from "react";
import ReactDom from "react-dom";
import {BrouserRouter}  from "react-router-dom";
import App from "./App";

ReactDom.render(
    <>
    <BrouserRouter>
        <App/>
    </BrouserRouter>
    </>,document.getElementById("root")
);
